var stompFailureCallback = function (error) {
    console.log('STOMP: Lost Connection');
    setTimeout(connect, 5000);
    console.log('STOMP: Reconecting in 5 seconds');
};


function connect() {
	
    var socket = new SockJS(url);
    var stompClient = Stomp.over(socket);
	stompClient.heartbeat.outgoing = 5000; // client will send heartbeats every 5000ms
    stompClient.heartbeat.incoming = 0; // client will receive heartbeats every 5000ms from server
    stompClient.reconnect_delay = 5000; // in case of a connection failure client automatic reconnect (delay is 5000ms)
    stompClient.connect(
		{Authorization: `sgdbf ${jwt}`},
		function () {  	  
		  
		  var sub = undefined;
		  
		  var onmessage = function (message) {
            message.ack();
            receiveMessages++;
		    sub.unsubscribe();
			//stompClient.disconnect();
          }
		  
		  sub = stompClient.subscribe(
			destination, 
			onmessage, 
			{Authorization: `sgdbf ${jwt}`, ack: 'client'}
	      );
		  if(connexions < maxConnexions) {
			  connexions++;
			  send();
		  }		  
		}, 
		 stompFailureCallback
	);
    
}

function sendPublisher(data) {

  var xhr = new XMLHttpRequest();
  xhr.withCredentials = true;
  
  xhr.addEventListener("readystatechange", function() {
    if(this.readyState === 4) {
      httpPublisherResponses++;
    }
  });
  
  xhr.open("POST", `${publisherApi}`);
  xhr.setRequestHeader("Content-Type", "application/json");
  xhr.setRequestHeader("Authorization", `sgdbf ${jwt}`);
  
  xhr.send(data);
  
  httpPublisherRequests++;
	
}

function sendNotifier(data) {
		
  var xhr = new XMLHttpRequest();
  xhr.withCredentials = true;
  
  xhr.addEventListener("readystatechange", function() {
    if(this.readyState === 4) {
      httpNotifierResponses++;
    }
  });
  
  xhr.open("POST", `${notifierApi}`);
  xhr.setRequestHeader("Content-Type", "application/json");
  xhr.setRequestHeader("Authorization", `sgdbf ${jwt}`);
  
  xhr.send(data);
  
  httpNotifierRequests++;
}


