function log() {
	var totalHttpRequests = httpPublisherRequests + httpNotifierRequests;
	var totalHttpResponses = httpPublisherResponses + httpNotifierResponses;
	
	console.log("SUBSCRIBER => " + 
				"Connexions: "+connexions+", "+
				"HttpPublisherRequests: "+httpPublisherRequests+", "+
				"HttpPublisherResponses: "+httpPublisherResponses+", "+
				"HttpNotifierRequests: "+httpNotifierRequests+", "+
				"HttpNotifierResponses: "+httpNotifierResponses+", "+
				"TotalHttpRequests: "+totalHttpRequests+", "+
				"TotalHttpResponses: "+totalHttpResponses+", "+
				"ReceiveMessages: "+receiveMessages
				);
}

function sleep(milliseconds) {
  const date = Date.now();
  let currentDate = null;
  do {
    currentDate = Date.now();
  } while (currentDate - date < milliseconds);
}

function run() {
	for (let i = 0; i < maxConnexions; i++) {
		console.log("Open connexion: " + i);
		//sleep(50);
		connect();
	}
}

setInterval(log, 1000);
run();
